import React, { Component } from 'react';
import { Text,StyleSheet, TouchableOpacity, ToastAndroid, Platform, AlertIOS, View } from 'react-native';
import { Container, Header, Left, Body, Right, Button, Icon, Title, Item, Input } from 'native-base';

export default class HeaderJS extends Component {

    searchPage(){
        if(Platform.OS === 'android'){
            ToastAndroid.show("Search Page Navigation", ToastAndroid.SHORT)
        }
        else if(Platform.OS === 'ios'){
            AlertIOS.alert('Search Page Navigation');
        }
        else if(Platform.OS === 'web'){
            alert('Search Page Navigation');
        }
    }

  render() {
    return (
        <Header style={styles.headerColor}>
          <Left>
          <TouchableOpacity onPress={ this.searchPage }>
            <Button transparent>
               <Text>DocApp</Text>
            </Button>
            </TouchableOpacity>
          </Left>
          <Body>
              <TouchableOpacity onPress={ this.searchPage }>
                  <View style={{ width: 350 }} >
                    <Button style={{ backgroundColor: 'white', elevation: 3, width: 350 }} onPress={this.searchPage}>
                        <Icon name='search' style={{ color: 'black' }}></Icon>
                        <Left>
                            <Text>Search....</Text>
                        </Left>
                    </Button>
                  </View>
              </TouchableOpacity> 
          </Body>
          <Right>
            <Button transparent>
              <Icon type="Feather" name='more-vertical' style={{ color: 'black' }}/>
            </Button>
          </Right>
        </Header>
    );
  }
}



const styles = StyleSheet.create({
    headerColor: {
        backgroundColor: 'white',
        elevation: 1
    },
    textColor: {
        color: 'black'
    }
});
